bool SYSTEMSaveFile(char *FileName)
{
	bool Result = false;
	HANDLE hFile; 
	DWORD  dwBytesWritten;
	hFile = CreateFile(FileName,GENERIC_WRITE,FILE_SHARE_READ,NULL,CREATE_ALWAYS,NULL,NULL);
	if (hFile == INVALID_HANDLE_VALUE) Result =false;
    if(WriteFile(hFile, SYSTEMMyFileBuf, SYSTEMMyFileSize, &dwBytesWritten, NULL)) Result =true;
	CloseHandle(hFile); 
	return Result;
}

